 export const MainMenu = () => {
  return (
      <>
      <Background />
      <div className="flex flex-col">
      <div className="flex justify-center">
      <TitleText />
      </div>
      <div className="">
        <Button />
      </div>
    </div></>
  );
};

export default MainMenu;
